window.bookSummaryJSON = "<p><b>Keep your friends close.</b></p> <p>After successfully striking back at the alien invaders, Commodore Jack Romanoff and his crew have liberated the cluster capital at Argent. For the first time, it seems like they might be getting their feet back underneath them.</p> <p><b>Keep your enemies closer.</b></p> <p>When the secretive Poseidon Group—the people behind the conspiracy that threatened the very security of the Confederation—attacks, Jack and his allies must stand back to back against the traitors. Can they unmask the traitors before a knife in the dark leaves them defenseless?</p> <p><b>Trust no one.</b></p>"; 
